  async getTestGroupTemplate(group, buildDir) {
    try {
      const hookIcon = hookSvgs["group"] || "";
      return `
            <div class="test-group" data-group-id="${group.testGroupId}">
                <div class="test-group-header">
                    <span class="test-group-icon">\u25B6</span>
                    <span class="" style="padding-top:0.3rem;">${hookIcon}</span>
                    <span class="test-group-name">${group.testGroupName}</span>
                </div>
                <div class="test-group-content">
                    ${await this.populateTestGroupDetails(group, buildDir)}
                </div>
            </div>
        `;
    } catch (error) {
      console.error(
        `Error generating test group template for ${group.testGroupId}:`,
        error
      );
      return `<div class="error">Error loading test group: ${error instanceof Error ? error.message : "Unknown error"}</div>`;
    }
  }
  getStatusIconHTML(status, options) {
    const normalized = status.trim().toLowerCase();
    const defaultColorMap = {
      passed: "#28a745",
      // green
      failed: "#dc3545",
      // red
      skipped: "#6c757d",
      // gray
      aborted: "#6c757d",
      "not started": "#6c757d",
      default: "#6c757d"
    };
    const colorMap = { ...defaultColorMap, ...options?.colorMap || {} };
    const color = colorMap[normalized] ?? colorMap["default"];
    const aria = this.escapeHtml(status);
    if (options?.useInlineStyle) {
      const style = [
        "display: inline-block",
        "width: 16px",
        "height: 16px",
        "margin-right: 4px",
        "font-size: 16px",
        "line-height: 1",
        `color: ${color}`
      ].join("; ");
      return `<span aria-label="${aria}" title="${aria}" style="${style}">\u25CF</span>`;
    } else {
      return `<span aria-label="${aria}" title="${aria}" class="status-icon" style="color: ${color};">\u25CF</span>`;
    }
  }
  getTestCaseTemplate(testCaseResponse, hookType = "testCase") {
    try {
      const requestCount = testCaseResponse.testResult === "PASSED" ? testCaseResponse.passed || 0 : testCaseResponse.testResult === "FAILED" ? testCaseResponse.failed || 0 : testCaseResponse.skipped || 0;
      const hasRequests = requestCount > 0;
      const statusIcon = this.getStatusIconHTML(
        testCaseResponse.testResult || "UNKNOWN"
      );
      const hookIcon = hookSvgs[hookType] || "";
      return `
            <div class="test-case ${testCaseResponse.testResult}${hasRequests ? " has-requests" : ""}" data-test-id="${testCaseResponse.testCaseId}">
                <div class="test-case-header" onclick="showTestCaseRequests('${testCaseResponse.testCaseId}', '${testCaseResponse.testResult}','${testCaseResponse}', '${testCaseResponse.testCaseName}','${hookType}')">
                    <span class="test-case-icon">${statusIcon}</span>
                       <span class="test-case-hook-icon">${hookIcon}</span>
                    <span class="test-case-name">${testCaseResponse.testCaseName}</span>
                </div>
                ${hasRequests ? `<div class="test-case-requests" style="display: none;">${this.populateTestCaseDetails(testCaseResponse)}</div>` : ""}
            </div>
        `;
    } catch (error) {
      console.error(
        `Error generating test case template for ${testCaseResponse.testCaseId}:`,
        error
      );
      return `<div class="error">Error generating test case template: ${error instanceof Error ? error.message : "Unknown error"}</div>`;
    }
  }
  formatEventScripts(events, type) {
    try {
      if (!events || events.length === 0) {
        return `<div class="no-data">${type === "prerequest" ? "No request pre-request available" : "No request tests available"}</div>`;
      }
      const matchingEvents = events.filter(
        (event) => event.listen === type
      );
      if (matchingEvents.length === 0) {
        return `<div class="no-data">No ${type} scripts</div>`;
      }
      try {
        const htmlBlocks = matchingEvents.map((event) => {
          const language = event.script?.type || "javascript";
          const code = (event.script?.exec || []).join("\n");
          const escapedCode = this.escapeHtml(code);
          return `
                        <div class="event-script">
                            <pre><code class="language-${language}">${escapedCode}</code></pre>
                        </div>`;
        });
        return `
                    <div class="event-section ${type}">
                        ${htmlBlocks.join("\n")}
                    </div>`;
      } catch (error) {
        return `<div class="error">Error formatting events: ${error}</div>`;
      }
    } catch (error) {
      console.error(
        `Error processing event scripts for type ${type}:`,
        error
      );
      return `<div class="error">Error processing event scripts: ${error instanceof Error ? error.message : "Unknown error"}</div>`;
    }
  }
  formatAssertions(assertions, testStepResponse) {
    try {
      if (!assertions || assertions.length === 0) {
        return `<div class="no-data">\u{1F50E} Scanned the lab\u2026 no tests found!</div>`;
      }
      try {
        const htmlItems = assertions.map((assertion, index) => {
          const name = this.escapeHtml(
            assertion.name ?? `Assertion #${index + 1}`
          );
          const passed = assertion.passed;
          const skipped = assertion.skipped;
          const status = skipped ? "skipped" : passed ? "passed" : "failed";
          const statusClass = `assertion-${status}`;
          const errorMsg = (
            // !passed && !skipped && assertion.error
            (testStepResponse?.rejectReason?.length ?? 0) > 0 ? `<div class="assertion-error">
              ${testStepResponse.rejectReason}
                          </div>` : ""
          );
          return `
        <div class="assertion-item ${statusClass}">
          <div class="assertion-header">
            <span class="assertion-name">${name}</span>
            <span class="assertion-status">${status.toUpperCase()}</span>
          </div>
          ${errorMsg}
        </div>
      `;
        });
        return `<div class="assertions">${htmlItems.join("")}</div>`;
      } catch (error) {
        return `<div class="error">Error formatting assertions: ${error}</div>`;
      }
    } catch (error) {
      console.error("Error processing assertions:", error);
      return `<div class="error">Error processing assertions: ${error instanceof Error ? error.message : "Unknown error"}</div>`;
    }
  }
